    static String solve_1st(String string, int size, int[] numbers) {
        // My solution
        // Fails some tests
        // Times out on some tests

        String answer = "";

        int max = 0;

        String weightTable = " abcdefghijklmnopqrstuvwxyz";
        int strLen = string.length();

        char letter = ' ';
        int letterWeight = 0;

        int nextIndex = 0;
        char nextLetter = ' ';
        int multiple = 0;

        TreeSet<Integer> uniformTable = new TreeSet<>();

        for (int index = 0; index < strLen; index++) {
            letter = string.charAt(index);
            letterWeight = weightTable.indexOf(letter);

            nextIndex = index + 1;
            if (!uniformTable.contains(letterWeight)) {
                multiple = 1;
                uniformTable.add(letterWeight * multiple);

                scanForward:
                while (nextIndex < strLen) {
                    nextLetter = string.charAt(nextIndex);
                    if (string.charAt(index) == string.charAt(nextIndex)) {
                        multiple += 1;
                        if (!uniformTable.contains(letterWeight * multiple)) {
                            max = (letterWeight * multiple > max) ? letterWeight * multiple : max;

                            //System.out.println("max: " + max + " " + letter + " * " + multiple + " = " + letterWeight * multiple);

                            uniformTable.add(letterWeight * multiple);
                        }
                        nextIndex += 1;
                    } else {
                        System.out.print("");
                        break scanForward;
                    }
                }
            }

        }
        for (int number : numbers) {
            if (uniformTable.contains(number))
                answer += answer.isEmpty() ? "Yes" : "\nYes";
            else
                answer += answer.isEmpty() ? "No" : "\nNo";
        }
        return (answer);
    }

    static String solve_2nd(String string, int size, int[] numbers) {
        // Discussion solution
        // Times out on some tests.

        String answer = "";

        int currentCharCount = 1;
        int lastAlphaNum = 0;
        Set<Integer> numList = new HashSet<Integer>();
        for (int i = 0; i < string.length(); i++) {
            int alphaNum = string.charAt(i) - 96;
            if (alphaNum == lastAlphaNum) currentCharCount++;
            else {
                currentCharCount = 1;
                lastAlphaNum = alphaNum;
            }
            numList.add(alphaNum * currentCharCount);
        }
        for (int index = 0; index < size; index++) {
            int x = numbers[index];
            if (numList.contains(x))
                answer += answer.isEmpty() ? "Yes" : "\nYes";
            else
                answer += answer.isEmpty() ? "No" : "\nNo";
        }
        return (answer);
    }

    static String solve_3d(String string, int size, int[] numbers) {
        // https://github.com/rshaghoulian solution
        // Times out on some tests

        Set<Integer> weights = new HashSet<>();
        int weight = 0;
        char prev = ' '; // so it doesn't match 1st character
        String answer = "";

        for (int i = 0; i < string.length(); i++) {
            char curr = string.charAt(i);
            if (curr != prev) {
                weight = 0;
            }
            weight +=  curr - 'a' + 1;
            weights.add(weight);
            prev = curr;
        }

        for (int number : numbers) {
            if (weights.contains(number))
                answer += answer.isEmpty() ? "Yes" : "\nYes";
            else
                answer += answer.isEmpty() ? "No" : "\nNo";
        }
        return (answer);
    }

    static String solve(String string, int size, int[] numbers) {
        // https://github.com/rshaghoulian
        // Deleted larger string in return type and all tests pass.

        // Traverse the string just 1 time. Save the weights of every possible
        // uniform substring in a HashSet.

        // Time complexity: O(n)
        // Space complexity: O(n)


        Set<Integer> weights = new HashSet<>();
        int weight = 0;
        char prev = ' '; // so it doesn't match 1st character
        String answer = "";

        for (int i = 0; i < string.length(); i++) {
            char curr = string.charAt(i);
            if (curr != prev) {
                weight = 0;
            }
            weight +=  curr - 'a' + 1;
            weights.add(weight);
            prev = curr;
        }

        for (int number : numbers) {
            if (weights.contains(number))
                System.out.println("Yes");
            else
                System.out.println("No");
        }
        return (" ");
    }

